    <script type="text/javascript">
// variables for the first series
var series_1_channel_id = 113163;
var series_1_field_number = 1;
var series_1_read_api_key = 'PBJIGZZJX2MHH2XU';
var series_1_results = 72;
var series_1_color = '#d62020';
var series_1_unit = ' %';

// variables for the second series
var series_2_channel_id = 113163;
var series_2_field_number = 2;
var series_2_read_api_key = 'PBJIGZZJX2MHH2XU';
var series_2_results = 72;
var series_2_color = '#00aaff';
var series_2_unit = ' °C';

// chart title
var chart_title = 'Garden Humidity & Temperature';
// y axis title
var y_axis0_title = 'Humidity';
var y_axis1_title = 'Temperature';


// user's timezone offset
var my_offset = new Date().getTimezoneOffset();
// chart variable
var my_chart;

// when the document is ready
$(document).on('ready', function() {
  // add a blank chart
  addChart();
  // add the first series
  addSeries(series_1_channel_id, series_1_field_number, series_1_read_api_key, series_1_results, series_1_color, 0, series_1_unit);
  // add the second series
  addSeries(series_2_channel_id, series_2_field_number, series_2_read_api_key, series_2_results, series_2_color, 1, series_2_unit);
});

// add the base chart
function addChart() {
  // variable for the local date in milliseconds
  var localDate;

  // specify the chart options
  var chartOptions = {
    chart: {
      renderTo: 'chart-container',
      defaultSeriesType: 'spline',
      backgroundColor: '#ffffff',
      events: {}
    },
    title: {
      text: chart_title
    },
    plotOptions: {
      series: {
        marker: {
          radius: 0
        },
        animation: true,
        step: false,
        borderWidth: 0,
        turboThreshold: 0
      }
    },
    xAxis: {
      type: 'datetime',
      title: {
        text: 'Date'
      }
    },
    yAxis: [{
      title: {
        text: y_axis0_title
      },
      labels: {
        format: '{value} ' + series_1_unit,
        style: {
          color: series_1_color
        }
      }
    }, {
      title: {
        text: y_axis1_title
      },
      labels: {
        format: '{value} ' + series_2_unit,
        style: {
          color: series_2_color
        }
      },
      opposite: true
    }],
    tooltip: {
      // reformat the tooltips so that local times are displayed
      formatter: function() {
        //return 'The value';
        return new Date(this.x + (my_offset * 60000));
        //var n = (this.point.name === undefined) ? '' : '<br>' + this.point.name;
        //return this.series.name + ':<b>' + this.y + '</b>' + n + '<br>' + d.toDateString() + '<br>' + d.toTimeString().replace(/\(.*\)/, "");
      },
      shared: true
    },
    exporting: {
      enabled: false
    },
    legend: {
      enabled: false
    },
    credits: {
      text: 'ThingSpeak.com',
      href: 'https://thingspeak.com/',
      style: {
        color: '#D62020'
      }
    }
  };

  // draw the chart
  my_chart = new Highcharts.Chart(chartOptions);
}

// add a series to the chart
function addSeries(channel_id, field_number, api_key, results, color, yaxis, unit) {
  var field_name = 'field' + field_number;

  // get the data with a webservice call
  $.getJSON('https://api.thingspeak.com/channels/' + channel_id + '/fields/' + field_number + '.json?offset=0&round=2&results=' + results + '&api_key=' + api_key, function(data) {

    // blank array for holding chart data
    var chart_data = [];

    // iterate through each feed
    $.each(data.feeds, function() {
      var point = new Highcharts.Point();
      // set the proper values
      var value = this[field_name];
      point.x = getChartDate(this.created_at);
      point.y = parseFloat(value);
      // add location if possible
      if (this.location) {
        point.name = this.location;
      }
      // if a numerical value exists add it
      if (!isNaN(parseInt(value))) {
        chart_data.push(point);
      }
    });

    // add the chart data
    my_chart.addSeries({
      data: chart_data,
      type: 'spline',
      name: data.channel[field_name],
      color: color,
      yAxis: yaxis,
      tooltip: {
        valueSuffix: unit
      }
    });
  });
}

// converts date format from JSON
function getChartDate(d) {
  // offset in minutes is converted to milliseconds and subtracted so that chart's x-axis is correct
  return Date.parse(d) - (my_offset * 60000);
}
</script>
